      </div> */}

      <div id='intro'>
        <div id='name'> 
          <h1>Hi,</h1>
          <h1> I'm Navid</h1>
          </div>
      </div>
      <div class="bouncing-text">
  <div class="b">B</div>
  <div class="o">O</div>
  <div class="u">U</div>
  <div class="n">N</div>
  <div class="c">C</div>
